webpackJsonp([1],{"+9Mk":function(module,exports){module.exports="00:03\xa0\n\n1\n\nHello {{name}},\n\n00:05\xa0\n\n2\n\nIf you\u2019ve made it here, then congratulations!\n\n00:09\xa0\n\n3\n\nBecause this means that your archetype is the Sage!\n\n00:12\xa0\n\n4\n\nBut what does this actually mean?\n\n{{#displayImage}} {path:'images/archetype-icons/sage.png', fadeIn: true} {{/displayImage}}\n\n00:15\xa0\n\n5\n\nDon\u2019t worry, everything you need to know will be on this page.\n\n00:19\xa0\n\n6\n\nStick to the end of it and I promise that\n\n00:22\xa0\n\n7\n\nyou\u2019ll experience something truly magical.\n\n00:25\xa0\n\n8\n\nThe quiz that you\u2019ve just taken is designed to identify your archetype\n\n00:30\xa0\n\n9\n\na personality profile that\u2019s broken down your entire being.\n\n{{#displayImage}} {path:'images/archetype-icons/sage.png', fadeOut: true} {{/displayImage}}\n\n00:35\xa0\n\n10\n\nYour tendencies, your strengths, your past, and your future.\n\n00:40\xa0\n\n11\n\nYour archetype takes into account your gender,\n\n00:43\xa0\n\n12\n\nyour marital status, how you\xa0answered the quiz,\n\n00:47\xa0\n\n13\n\nand how long you took to get those answers.\n\n00:50\xa0\n\n14\n\nThat\u2019s right, {{name}}.\n\n00:52\xa0\n\n15\n\nYou can use that information to make astronomical changes\xa0in your life.\n\n00:56\xa0\n\n16\n\nYou\u2019ll be able to leverage on your strengths, improve on your weaknesses,\n\n01:01\xa0\n\n17\n\nand embark on the life that you\u2019ve always dreamed of.\n\n01:04\xa0\n\n18\n\nBut before we get into that, I want to share with you about your archetype, The Sage,\n\n01:10\xa0\n\n19\n\nand what it means.\n\n01:12\xa0\n\n20\n\n{{name}}, you truly are a unique individual.\n\n01:15\xa0\n\n21\n\nAnd I genuinely believe that this world needs more people like you.\n\n01:19\xa0\n\n22\n\nYou are a wise soul that\u2019s overflowing with knowledge and wisdom.\n\n01:24\xa0\n\n23\n\nIf you were a vehicle, knowledge and wisdom would be your fuel \u2013 it\u2019s what drives you.\n\n01:31\xa0\n\n24\n\nYou\u2019re different that way, {{name}}.\n\n01:33\xa0\n\n25\n\nWhile the world walks in one direction, you have no qualms with going against it.\n\n01:39\xa0\n\n26\n\nThat\u2019s what makes you so special, {{name}}.\n\n01:43\xa0\n\n27\n\nYou\u2019re deeply intuitive and introspective.\n\n01:47\xa0\n\n28\n\nUnlike others, your education doesn\u2019t stop after graduating from college or university.\n\n01:53\xa0\n\n29\n\nYou are constantly applying and enriching yourself throughout the course of your life.\n\n01:57\xa0\n\n30\n\n{{name}}, you might not know it yet,\n\n01:59\xa0\n\n31\n\nbut you are more morally and ethically upright than others.\n\n02:03\xa0\n\n32\n\nYou hold your values and principles close to your heart,\n\n02:06\xa0\n\n33\n\nand you\u2019re always ready to stick to your guns.\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeIn: true} {{/displayImage}}\n\n02:09\xa0\n\n34\n\nThere is something else about you, {{name}}\u2026\n\n02:11\xa0\n\n35\n\nYou form the foundation of the world\u2019s progress and advancement.\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeOut: true} {{/displayImage}}\n\n02:17\xa0\n\n36\n\n{{name}}, I\u2019m getting the sense that you\u2019re going to live a long, and happy life.\n\n02:21\xa0\n\n37\n\nAnd although success might not be at your feet right now,\n\n02:24\xa0\n\n38\n\nyour riches and fulfilment are merely waiting for you.\n\n02:27\xa0\n\n39\n\nBut there\u2019s something else, {{name}}.\n\n02:30\xa0\n\n40\n\nEven though you will triumph, your path to success will not come easy.\n\n02:35\xa0\n\n41\n\nYou must ultimately defeat and control your hatred for ignorance.\n\n02:39\xa0\n\n42\n\nIt is vital for you to understand that not everyone is capable of learning at your pace,\n\n02:44\xa0\n\n43\n\nand not everyone shares the same passion as you do for knowledge.\n\n02:48\xa0\n\n44\n\n{{name}}, don\u2019t let that discourage you.\n\n02:50\xa0\n\n45\n\nThe world needs your wisdom.\n\n02:52\xa0\n\n46\n\nThe world needs people like you to be in positions of power.\n\n02:56\xa0\n\n47\n\nYou keep the world moving forward.\n\n02:59\xa0\n\n48\n\nYou do, however, need to understand that it\u2019s important for you\n\n03:03\xa0\n\n49\n\nto exercise humility in both your thoughts and actions.\n\n03:06\xa0\n\n50\n\nThat way, you\u2019ll be able to build trust and create even more fruitful interactions.\n\n03:11\xa0\n\n51\n\nAfter all, {{name}}, you tend to struggle when it comes to taking action\n\n03:15\xa0\n\n52\n\nand humility will lead you down the road of embracing failure,\n\n03:19\xa0\n\n53\n\nwhich will then lead you to the path towards success.\n\n03:21\xa0\n\n54\n\n{{name}}, I can already tell that your friends and family really look up to you.\n\n03:26\xa0\n\n55\n\nYou\u2019re the one who they come to for detailed advice, a listening ear,\n\n03:30\xa0\n\n56\n\nor just for a quick chat.\n\n03:32\xa0\n\n57\n\nYou\u2019re not the type of person to have huge circles of friends.\n\n03:36\xa0\n\n58\n\nYou\u2019re not someone who has trouble with making friends.\n\n03:39\xa0\n\n59\n\nIn fact, you have no trouble at all when it comes to impressing others\n\n03:43\xa0\n\n60\n\nwith your intelligence and wisdom.\n\n03:45\xa0\n\n61\n\nBut you\u2019re extremely selective with who you choose to let into your life.\n\n03:49\xa0\n\n62\n\nYou prefer to keep your loved ones close, and your wolf pack small.\n\n03:53\xa0\n\n63\n\n{{name}}, you are incredibly nurturing.\n\n03:57\xa0\n\n64\n\nYou possess the unique ability to connect with others\n\n04:00\xa0\n\n65\n\nand blend into any social group.\n\n04:03\xa0\n\n66\n\nYou have a great deal to offer to this world. {{name}},\n\n04:05\xa0\n\n67\n\nno one is able to play the role\xa0of an advisor and guide as excellently as you.\n\n04:10\xa0\n\n68\n\nI sense that you will find success and fulfilment\n\n04:14\xa0\n\n69\n\nas a business advisor, a researcher, a data scientist, or a consultant.\n\n04:19\xa0\n\n70\n\nYou can be very intuitive, {{name}}.\n\n04:22\xa0\n\n71\n\nDespite your great capacity for knowledge, you prioritize your intuition over facts,\n\n04:28\xa0\n\n72\n\nespecially when it comes to making important decisions.\n\n04:31\xa0\n\n73\n\nAnd that\u2019s what works best for you.\n\n04:33\xa0\n\n74\n\n{{name}}, you are going to make a lasting mark in your lifetime.\n\n04:38\xa0\n\n75\n\nYou\u2019re able to look at the world from a broad and altruistic perspective.\n\n04:42\xa0\n\n76\n\nYou see the big picture, and you have what it takes to\n\n04:45\xa0\n\n77\n\nmake this world a richer and more informed place for everyone.\n\n04:48\xa0\n\n78\n\n{{name}}, you are practically a bookworm\n\n04:51\xa0\n\n79\n\n\u2013 possessing the uncanny ability to bury yourself with endless readings.\n\n04:56\xa0\n\n80\n\nYou take an interest in a broad number of subjects, and your fulfilment is derived\xa0from learning.\n\n05:01\xa0\n\n81\n\nYou excel at one-on-one interactions,\n\n05:04\xa0\n\n82\n\nand never fail to make an excellent impression on others during such situations.\n\n05:08\xa0\n\n83\n\nHowever, it is vital for you to understand that your introverted nature\n\n05:12\xa0\n\n84\n\nmakes you struggle to speak to larger groups of people.\n\n05:15\xa0\n\n85\n\nUltimately, {{name}}, you are a realist. You have a clear conscience.\n\n05:21\xa0\n\n86\n\nDiscerning right from wrong has never been a difficult task for you.\n\n05:25\xa0\n\n87\n\nI\u2019m getting the sense that you\u2019re not too concerned about monetary riches,\n\n05:29\xa0\n\n88\n\nalthough you do wish you had more wealth.\n\n05:32\xa0\n\n89\n\nThere is, however, a greater purpose for you in this lifetime, {{name}}.\n\n05:35\xa0\n\n90\n\nHowever, {{name}}, your purpose and direction in life might feel empty at times.\n\n05:39\xa0\n\n91\n\nAnd that is something that you need to be careful of.\n\n05:42\xa0\n\n92\n\nYou might feel as if you\u2019re living your life for the sake of learning,\n\n05:46\xa0\n\n93\n\nand you continue doing what you do because it\u2019s the only thing you know how to do.\n\n05:50\xa0\n\n94\n\nThat\u2019s not what you want, {{name}}. You want to live life for yourself. You want to love yourself.\n\n05:58\xa0\n\n95\n\nWhen you\u2019re able to do that, success and the life of your dreams will follow.\n\n06:03\xa0\n\n96\n\nAnd that\u2019s what Individuation aims to teach you.\n\n06:06\xa0\n\n97\n\nBut there\u2019s more to what I\u2019ve learned about you, {{name}}\u2026\n\n06:10\xa0\n\n98\n\nIt feels to me that you\u2019re a deeply emotional and spiritual person.\n\n06:14\xa0\n\n99\n\nYou\u2019re connected to your soul in a way that\u2019s far more profound than others.\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeIn: true} {{/displayImage}}\n\n06:19\xa0\n\n100\n\nYour thought process does not follow the rules and logic of the world.\n\n06:23\xa0\n\n101\n\nIn fact, I get\xa0the sense that you have quite the imagination.\n\n06:27\xa0\n\n102\n\nYour thoughts and dreams are vivid, colourful, and symbolic of who you are as an individual.\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeOut: true} {{/displayImage}}\n\n06:33\xa0\n\n103\n\n{{name}}, you\u2019re not someone who likes to argue.\n\n06:37\xa0\n\n104\n\nYou tend to avoid conflict and you\u2019re uncanny\n\n06:40\xa0\n\n105\n\nwhen it comes to devising win-win situations.\n\n06:43\xa0\n\n106\n\nBut when backed into a corner, you\u2019re not one to back down.\n\n06:47\xa0\n\n107\n\nYou fight fiercely for your loved ones and for your righteousness.\n\n06:51\xa0\n\n108\n\nYou\u2019re the first person to step in when you see a fight breaking out.\n\n06:55\xa0\n\n109\n\nYou\u2019re the first person to reach for your pockets in the sight of a struggling busker.\n\n07:00\xa0\n\n110\n\nYou\u2019re the first person your friends call when they\u2019ve had a horrible day.\n\n07:04\xa0\n\n111\n\nYou\u2019re the one who people rely on and look up to.\n\n07:07\xa0\n\n112\n\n{{name}}, you are the guardian of the world.\n\n07:10\xa0\n\n113\n\nBut every superhero needs a side-kick; a partner in crime who will stick by them when the going gets tough.\n\n{{#displayImage}} {path:'images/love-compatibility/sage-love-compatibility.png', fadeIn: true} {{/displayImage}}\n\n07:17\xa0\n\n114\n\nThis little chart I\u2019ve prepared represents the archetypes\n\n07:21\xa0\n\n115\n\nthat you\u2019re most likely to end up with.\n\n07:23\xa0\n\n116\n\nOr if you\u2019re already in a committed relationship,\n\n07:25\xa0\n\n117\n\nthere\u2019s a really good chance that your spouse is one of those archetypes.\n\n07:29\xa0\n\n118\n\n{{name}}, you\u2019re not the kind of person that has trouble when it comes to love.\n\n07:34\xa0\n\n119\n\nPeople find themselves drawn to your charisma and kind nature.\n\n07:38\xa0\n\n120\n\nYou\u2019re sort of a rare breed when it comes to love.\n\n07:41\xa0\n\n121\n\nYou communicate better than\xa0anyone else,\n\n07:43\xa0\n\n122\n\nand you\u2019re an incredibly thoughtful individual.\n\n07:46\xa0\n\n123\n\nThe relationships that you forge with potential lovers are always profound and deep.\n\n07:50\xa0\n\n124\n\nYou become very selective with who you choose to date\n\n07:54\xa0\n\n125\n\nand who you choose to end up with \u2013 for good reason, of course.\n\n07:58\xa0\n\n126\n\nI sense that in the coming years, you will be the happiest you\u2019ve ever been in that regard.\n\n{{#displayImage}} {path:'images/love-compatibility/sage-love-compatibility.png', fadeOut: true} {{/displayImage}}\n\n08:03\xa0\n\n127\n\n{{name}}, I\u2019m sensing that your love life isn\u2019t going to be the smoothest\n\n08:07\xa0\n\n128\n\n\u2013 but you will find that happiness that you\u2019re looking for soon enough.\n\n08:11\xa0\n\n129\n\nBut don\u2019t forget, {{name}}, how you perceive yourself should not be determined by your love life.\n\n08:18\xa0\n\n130\n\nYour spouse or partner is meant to play a supporting role in your life; not the lead.\n\n08:23\xa0\n\n131\n\nFocus on your own personal growth, and I promise you,\n\n08:27\xa0\n\n132\n\n{{name}}, you will soon discover heavenly rewards."}});
